    true,nt"url": null,nt"notes": "U.S. Census Grids (Summary File 1), 2000
    contain grids of demographic and socioeconomic data nnfrom the year 2000 U.S. census
    in ASCII and geotiff formats. The grids have a resolution of 30 arc-seconds (0.0083
    decimal degrees), nnor approximately 1 square km. The gridded variables are based
    on census block geography from Census 2000 TIGER/Line Files and census nnvariables
    (population, households, and housing variables). This dataset is produced by the
    Columbia University Center for nnInternational Earth Science Information Network
    (CIESIN).",nt"license_title": "U.S. Government Work",nt"extras": [{ntt"key":
